function twoSum(numbers: number[], target: number): number[]{
    if(numbers[0] < 0){
        let upperBound = target - numbers[0]
        let i = numbers.findIndex((num, index) => num === upperBound && index !== 0)
        numbers = numbers.filter(num => num <= upperBound)
        if(i !== -1)
            return [1, i+1]
    }
    else{
        numbers = numbers.filter(num => num <= target)
    }


    for(let i = 0; i < numbers.length; i++){
        let num1 = numbers[i]
        let num2 = target - numbers[i]
        let index = numbers.findIndex((num, index) => num === num2 && index !== i)
        if(index !== -1)
            return [i+1,index+1]
    }
    return []
}
